import { React, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Swal from "sweetalert2";
import { Container, Card, Button, Row, Col } from "react-bootstrap";
import product1 from "../img/product/LeMansBlouse.jpg";
import product2 from "../img/product/CassieDress.jpg";
import product3 from "../img/product/ForteTopDress.jpg";
import product4 from "../img/product/LuaJibblingPants.jpg";

export default function Product() {
  const [data, setData] = useState([]);
  const history = useNavigate();
  useEffect(() => {
    fetchUsers();
  }, []);
  const fetchUsers = async (e) => {
    let token = sessionStorage.getItem("access_token");
    fetch("http://127.0.0.1:8000/api/get_users", {
      method: "GET",
      headers: {
        Authorization: `Bearer ${token}`,
        "Content-Type": "application/json",
        Accept: "application/json",
      },
    })
      .then((res) => res.json())
      .then(
        (json) => {
          setData(json.users);
        },
        (error) => {
          alert(error);
        }
      );
  };
  const edit = (id) => {
    history("/useredit", { state: { id } });
  };
  const deletef = (id) => {
    Swal.fire({
      title: "Apakah anda yakin ?",
      text: "Akan menghapus data ini",
      icon: "warning",
      showCancelButton: true,
      confirmButtonColor: "#3085d6",
      cancelButtonColor: "#d33",
      confirmButtonText: "Ya",
    }).then((result) => {
      if (result.isConfirmed) {
        let token = sessionStorage.getItem("access_token");
        fetch("http://127.0.0.1:8000/api/delete_user/" + id, {
          method: "GET",
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "application/json",
            Accept: "application/json",
          },
        })
          .then((res) => res.json())
          .then(
            (json) => {
              Swal.fire("Deleted!", "Deleted Successfully.", "success");
              fetchUsers();
            },
            (error) => {
              alert(error);
            }
          );
      }
    });
  };

  return (
    <Container className="mt-5">
      <Button variant="primary">Primary</Button>

      <Row className="konten-product">
        <Col lg={3} sm={12} className="product mb-5">
          <Card className="card rounded-0" style={{ lineHeight: "10px" }}>
            <Card.Img className="rounded-0" variant="top" src={product1} />
            <Card.Body className="card-body">
              <Card.Title className="card-title">
                Le Mans Blouse Khaki
              </Card.Title>
              <Card.Text className="card-text">IDR. 150.000</Card.Text>
              <Button
                className="btn-order d-grid gap-2 col-12 mx-auto text-uppercase"
                href="./FormPemesanan"
              >
                Order Now
              </Button>
            </Card.Body>
          </Card>
        </Col>

        <Col lg={3} sm={12} className="mb-5">
          <Card className="card rounded-0" style={{ lineHeight: "10px" }}>
            <Card.Img className="rounded-0" variant="top" src={product2} />
            <Card.Body className="card-body">
              <Card.Title className="card-title">Cassie Dress</Card.Title>
              <Card.Text className="card-text">IDR. 150.000</Card.Text>
              <Button
                className="btn-order d-grid gap-2 col-12 mx-auto text-uppercase"
                href="./FormPemesanan"
              >
                Order Now
              </Button>
            </Card.Body>
          </Card>
        </Col>

        <Col lg={3} sm={12} className="mb-5">
          <Card className="card rounded-0" style={{ lineHeight: "10px" }}>
            <Card.Img className="rounded-0" variant="top" src={product3} />
            <Card.Body className="card-body">
              <Card.Title className="card-title">Forte Top Shirt</Card.Title>
              <Card.Text className="card-text">IDR. 150.000</Card.Text>
              <Button
                className="btn-order d-grid gap-2 col-12 mx-auto text-uppercase"
                href="./FormPemesanan"
              >
                Order Now
              </Button>
            </Card.Body>
          </Card>
        </Col>

        <Col lg={3} sm={12} className="mb-5">
          <Card className="card rounded-0" style={{ lineHeight: "10px" }}>
            <Card.Img className="rounded-0" variant="top" src={product4} />
            <Card.Body className="card-body">
              <Card.Title className="card-title">Lua Jibbling Pants</Card.Title>
              <Card.Text className="card-text">IDR. 150.000</Card.Text>
              <Button
                className="btn-order d-grid gap-2 col-12 mx-auto text-uppercase"
                href="./FormPemesanan"
              >
                Order Now
              </Button>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}
